import React from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { motion } from "framer-motion";
import { FaBell } from "react-icons/fa";

const HomePage = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-4">
      <motion.div
        initial={{ opacity: 0, scale: 0.8 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5 }}
        className="mb-6"
      >
        <img src="/logo.png" alt="Swift Notify Logo" className="w-32 h-32" />
      </motion.div>
      <Card className="w-full max-w-md p-6 shadow-lg">
        <CardContent className="flex flex-col items-center text-center">
          <h1 className="text-2xl font-bold text-gray-900">Bienvenue sur Swift Notify</h1>
          <p className="text-gray-600 mt-2">
            Gérez vos notifications SWIFT en toute simplicité et efficacité.
          </p>
          <Button className="mt-4 flex items-center gap-2" size="lg">
            <FaBell /> Découvrir
          </Button>
        </CardContent>
      </Card>
    </div>
  );
};

export default HomePage;
